Here is the step-by-step guide to create a React,Node.js, and Express.js web app for creating, adding dummy data, and showing it:

**Step 1: Create a new React app**

Open your terminal and run the following command to create a new React app:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node.js and Express.js server**

In the same terminal, navigate to the `my-app` directory and run the following command to create a new Node.js and Express.js server:
```
npm init -y
npm install express
```
This will create a new `package.json` file and install Express.js.

**Step 3: Create a new file for the server**

Create a new file called `server.js` in the `my-app` directory and add the following code:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

let data = [
  { id: 1, name: 'John Doe', age: 30 },
  { id: 2, name: 'Jane Doe', age: 25 },
  { id: 3, name: 'Bob Smith', age: 40 },
];

app.get('/api/data', (req, res) => {
  res.json(data);
});

app.post('/api/data', (req, res) => {
  const newData = req.body;
  data.push(newData);
  res.json(data);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code creates an Express.js server that listens on port 3001 and has two endpoints: `/api/data` to retrieve the data and `/api/data` to add new data.

**Step 4: Create a new React component to display the data**

Create a new file called `Data.js` in the `my-app/src` directory and add the following code:
```
import React, { useState, useEffect } from 'react';

function Data() {
  const [data, setData] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3001/api/data')
      .then(response => response.json())
      .then(data => setData(data));
  }, []);

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            <span>{item.name}</span>
            <span>{item.age}</span>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default Data;
```
This code creates a new React component that fetches the data from the server and displays it in an unordered list.

**Step 5: Add the React component to the App.js file**

Open the `App.js` file in the `my-app/src` directory and add the following code:
```
import React from 'react';
import Data from './Data';

function App() {
  return (
    <div>
      <Data />
    </div>
  );
}

export default App;
```
This code adds the `Data` component to the `App` component.

**Step 6: Start the server and the React app**

Open two terminals and navigate to the `my-app` directory. In one terminal, run the following command to start the server:
```
node server.js
```
